import React, { Component } from 'react';

class MovieCard extends Component {
  render() {
    console.log(this.props.card);
    return (
      <section>
      <h2>Supernatural3</h2>
      <p>Horror</p>
      <img
        src="https://www.themoviedb.org/t/p/w1280/ovFzkkKknAo2SbM2DfOabxRvzmy.jpg" alt="Supernatural" />
      <h3>
        <ul>
          <li>Sam</li>
          <li>Dean</li>
        </ul>
      </h3>
    </section>
    );
  }
}

export default MovieCard;
